import sys
import binascii

def strxor(a, b):     # xor two strings of different lengths
  if len(a) > len(b):
    return "".join([chr(ord(x) ^ ord(y)) for (x, y) in zip(a[:len(b)], b)])
  else:
    return "".join([chr(ord(x) ^ ord(y)) for (x, y) in zip(a, b[:len(a)])])

def bytesxor(a, b):
  if len(a) > len(b):
    return [chr(x ^ y) for (x, y) in zip(a[:len(b)], b)]
  else:
    return [chr(x ^ y) for (x, y) in zip(a, b[:len(a)])]


def cancel_message(message_key, target):
  key_bytes = bytes([ord(c) for c in message_key])
  target_bytes = bytes([ord(c) for c in target])
  output = bytesxor(key_bytes, target_bytes)
  return output

def un_dot_pad(message_key, target, noinfo='.'):
  key_bytes = bytes([ord(c) for c in message_key])
  target_bytes = bytes([ord(c) for c in target])
  output = bytesxor(key_bytes, target_bytes)
  for i in range(0, len(output)):
    if message_key[i] == noinfo:
      output[i] = noinfo
  return output

